import React from 'react'

import { TextField } from '@mui/material'

const LivingPlaceRegistrationStep2 = () => {
    return (
        <>
            <TextField id='outlined-basic' label='Complex name' variant='outlined' />
            <TextField id='outlined-basic' label='Street' variant='outlined' />
            <TextField id='outlined-basic' label='House number' variant='outlined' />
        </>
    )
}

export default LivingPlaceRegistrationStep2
